import React from "react";
import Navbar from "./Navbar";
import { useParams } from "react-router-dom";
import { Link } from "react-router-dom";
import product1 from "../Assets/product1.png";

import Footer from "./Footer";

const LCard = () => {
  const params = useParams();

  return (
    <>
      <Navbar />
      <div className="container">
        <div className="row">
          <div className="col-12">
            <h1 className="text-center my-5"> Clicked Product Detail </h1>
          </div>
          <div className="col-md-6">
            <img src={product1} alt="" />
          </div>
          <div className="col-md-6 pb-5 d-grid justify-content-center align-item-center">
            <h2> {params.title} </h2>
            <p className="text-muted">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. In sit, at voluptatibus optio odit accusantium est distinctio. Dolorum officiis sed accusantium nemo et mollitia, est dolor quidem, optio, modi obcaecati.
            </p>
            <h2 className="mb-5"> {params.price} </h2>
            <Link to={"/contact"} className='light_Btn'> ADD TO CARD </Link>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default LCard;
